import { Amount, Button, ChargeScreenContainer } from './ChargeScreen.styled';

export default function ChargeScreen() {
  return (
    <ChargeScreenContainer flex>
      <Amount type="text" flex justify="center" align="center">
        500원
      </Amount>
      <Button flex justify="center" align="center">
        클릭
      </Button>
    </ChargeScreenContainer>
  );
}
